import React from 'react';
import '../../styles/footer.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub, faLinkedin } from '@fortawesome/free-brands-svg-icons';

function Footer() {
  return (
    <div className="footer">
      {/* Wavy background */}
      <div className="footer-wave-bg">
        <svg viewBox="0 0 1440 320" className="wave-svg">
          <path
            fill="#ff6600"
            fillOpacity="1"
            d="M0,192L60,192C120,192,240,192,360,170.7C480,149,600,107,720,101.3C840,96,960,128,1080,160C1200,192,1320,224,1380,240L1440,256L1440,320L1380,320C1320,320,1200,320,1080,320C960,320,840,320,720,320C600,320,480,320,360,320C240,320,120,320,60,320L0,320Z"
          ></path>
        </svg>
      </div>

      {/* Actual footer content */}
      <div className="footer-content">
        <span>vishalvoorugonda28@gmail.com</span>
        <div className="links-image">
          <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer" className="social-icon git">
            <FontAwesomeIcon icon={faGithub} />
          </a>
          <a href="https://linkedin.com/in/yourprofile" target="_blank" rel="noopener noreferrer" className="social-icon linkedin">
            <FontAwesomeIcon icon={faLinkedin} />
          </a>
        </div>
      </div>
    </div>
  );
}

export default Footer;
